function Profile(){
    return(
        <div className="profile">
            <h2>
                <p>Фамилия</p>
                <p>Имя</p>
                <p>01.10.2000</p>
                <p>volonterspb@gmail.com</p>
            </h2>
        </div>
    )
}
export default Profile;
